module.exports = {
  siteTitle: "Anurag More | Computer Science Engineer",
  name: "Anurag More",
  email: "anuragbmore@gmail.com",
  github: "https://github.com/anurag1299",
  socialMedia: [
    {
      name: "GitHub",
      url: "https://github.com/anurag1299",
    },
    {
      name: "Linkedin",
      url: "https://www.linkedin.com/in/anurag-more-9aa67a19a/",
    },
    {
      name: "Instagram",
      url: "https://www.instagram.com/ludum_elit",
    },
  ],

  navHeight: 100,
  navLinks: [
    {
      name: "About",
      url: "/#about",
    },
    {
      name: "Education",
      url: "/#college",
    },
    {
      name: "Work",
      url: "/#projects",
    },
    {
      name: "Contact",
      url: "/#contact",
    },
  ],
  colors: {
    blue: "#007BFF",
    navy: "#171C28",
    lightNavy: "#8892B0",
    lightestNavy: "#CCD6F6",
  },
  srConfig: (delay = 200) => ({
    origin: "bottom",
    distance: "20px",
    duration: 500,
    delay,
    rotate: { x: 0, y: 0, z: 0 },
    opacity: 0,
    scale: 1,
    easing: "cubic-bezier(0.645, 0.045, 0.355, 1)",
    mobile: true,
    reset: false,
    useDelay: "always",
    viewFactor: 0.25,
    viewOffset: { top: 0, right: 0, bottom: 0, left: 0 },
  }),
};
